import { NavLink } from "react-router-dom";
import s from "./Dialogs.module.css";

const DialogItem = (props) => {
  return (
    <div className={s.dialog + " " + s.active}>
      <NavLink to="/dialogs/1">{props.name}</NavLink>
    </div>
  );
};

const Dialogs = (props) => {
  return (
    <div className={s.dialogs}>
      <div className={s.dialogsItems}>
        <DialogItem name="Vadick" />
        <DialogItem name="Alina" />
        <DialogItem name="Chesterok" />
        <DialogItem name="Puppy" />
        <DialogItem name="Another Puppy" />
        <DialogItem name="Another cat" />
      </div>
      <div className={s.messages}>
        <div className={s.message}>Hi</div>
        <div className={s.message}>Mew mew</div>
        <div className={s.message}>Bark bark</div>
      </div>
    </div>
  );
};

export default Dialogs;
